    "type": {"generic": "event", "specific": "lineup"},
    "title": "8 week Introduction to the World of Wine Course @ The Big Yellow Self Storage Company - The Wine Cellars @ 2017-01-19",
    "link": "http://www.westlondonwineschool.com/product_info.php?id=598",
    "byline": "Food & Drink Events",
    "description": "<div>\n<div>\n\n\t\t<p><strong>WHO IS THIS COURSE DESIGNED FOR? </strong><span>\"Fantastic course, very friendly atmosphere\"</span><strong>(David &amp; Kathryn Hockley, 8-week Course April 2011)</strong></p>\n\n<p>The introductory 8 week Wonderful World of Wine Course is structured as a practical introduction to the world of wine. It is designed specifically for people who enjoy wine and would like to learn more about it. You do not need any previous experience, the emphasis is on learning by tasting different varieties of wine with friendly people. It is also a great way to meet new friends who share your love of wine.</p>\n\n<p><strong>What if I have to miss a session?</strong> We understand most Londoners have a hectic schedule therefore the course is flexible and you can redeem missed sessions at a later date or send a subsitute. <strong>We run these courses several times a year.</strong> All you need to do is let us know at least<strong> 3 days before the session you are going to miss</strong> and we will transfer you onto the next time that class rolls around.</p>\n\n<p><strong>WHAT SHOULD I GET FROM THE COURSE?</strong></p>\n\n<p><strong>By the end of the 8 Evenings:</strong></p>\n\n<ul>\n<li>You will have gained a good understanding of the world's major grape varieties and the wine styles they produce.</li>\n\n    <li>You will have been taught to assess, &amp; taste wine like a true professional, and be able to identify any faults found in wine (e.g. a corked wine).</li>\n\n    <li>You will have tasted wines from most of the worlds major wine regions (Tasting approx 55-60 wines)</li>\n\n    <li>Food &amp; wine matching will also have given you a lot of confidence to try new wine pairings with your favourite foods.</li>\n\n    <li>You will also have developed your sense of smell and wine vocabulary &amp; met some lovely new friends</li>\n\n</ul>\n<p>If you are unsure if this is the right course for you then <a href=\"http://www.tripadvisor.co.uk/Attraction_Review-g186338-d2265004-Reviews-West_London_Wine_School-London_England.html\" target=\"_blank\"><strong>click here</strong></a> to read reviews on Trip Advisor about West London Wine School.</p>\n\n<p><strong>Course Dates</strong> (all Wednesdays):</p>\n\n<ul>\n<li>\n<b>15th Feb</b> - France I - Burgundy &amp; Loire with Intro to Wine Tasting</li>\n\n    <li>\n<strong>22nd Feb </strong>- France II - Bordeaux, Rhone &amp; South France</li>\n\n    <li>\n<b>1st March</b> - Europe I - Alsace, Germany, UK &amp; Austria</li>\n\n    <li>\n<b>8th March</b> - Europe II - Italy, Spain &amp; Portugal</li>\n\n    <li>\n<b>15th March</b> - New World I - Australia &amp; New Zealand</li>\n\n    <li>\n<b>22nd March</b> - New World II - Chile &amp; Argentina</li>\n\n    <li>\n<b>29th March</b> - New World III - USA &amp; South Africa</li>\n\n    <li>\n<b>5th April</b> - Sparkling &amp; Sweet Wines</li>\n\n</ul>\n<p>Professional ISO tasting glasses, comprehensive tasting notes, course handouts, maps, booklets and some food are all provided.</p>\n\n<p><strong>COURSE FEE STRUCTURE:</strong></p>\n\n<p>The course fee is £200. As a way of spreading out the cost, we ask for £120 payment on booking and then £10 in cash each evening. A great value and a saving on booking each night separately (this works out to £25 per evening - usual cost if you booked on a single evening is £27.50 to £30 per evening).</p>\n\n<p><strong>Places remaining: </strong>0</p>\n\n\t\t<p><strong>Course Date/Time: </strong>Wed 15th Feb 2017 at 7pm</p>\n\n\t\t<p><strong>Duration: </strong>2 hrs for 8 wks</p>\n\n\t\t<p><strong>Venue: </strong>The Wine Cellars, Fulham</p>\n\n\n\n\t</div>\n\n\t<div>Event Price: £120.00\n\n\t\t</div>\n</div>\n",
