    "type": {"generic": "event", "specific": "lineup"},
    "title": "World of Wine: Bordeaux, Rhone & South @ The Big Yellow Self Storage Company - The Wine Cellars @ 2017-01-19",
    "link": "http://www.westlondonwineschool.com/product_info.php?id=532",
    "byline": "Food & Drink Events",
    "description": "<div>\n<div>\n\n\t\t<p> Welcome to the World of Wine tasting on <strong>Bordeaux, Rhone and the South of France</strong>. Time for some <strong>blockbuster reds!</strong></p>\n\n<p><strong>Part One – Bordeaux</strong></p>\n\n<p>Claret, traditional-British for Bordeaux, has been a firm favourite of ours for centuries. The quintessential classic reds from high-esteemed villages such as Margaux, Pauillac and <strong>St. Emilion</strong> are those that are layered, complex and destined to develop over decades before being enjoyed. We will explore why this is and focus on the key grapes such as <strong>Cabernet Sauvignon</strong>, <strong>Merlot </strong>and <strong>Cabernet Franc</strong> to understand what makes good Bordeaux great.</p>\n\n<p><strong>Part Two – Rhone &amp; the South</strong></p>\n\n<p>In the South of France lies the <strong>Rhone Valley</strong>, its’ myriad of canals and its abundance of vineyards. Here we find the blockbuster <strong>Syrah (Shiraz)</strong> and its’ multifaceted styles. In addition we find the spicy <strong>Grenache</strong>, and these two grapes together exist because of the hot climate down here, making more intense and full-bodied wines. We’ll explore classics such as <strong>Chateauneuf-du-Pape</strong>, Vacqueras and Hermitage and compare them to their inexpensive counterparts dotted around Mediterranean coast in Southern France.</p>\n\n<p>All tastings include; minimum of 6 wines sourced locally so you can find them easily if you like them, full tasting notes, tasting sheet, use of professional tastings glasses and nibbles.</p>\n\n<p><strong>Places remaining: </strong>0</p>\n\n\t\t<p><strong>Course Date/Time: </strong>Tue 31st Jan 2017 at 7pm</p>\n\n\t\t<p><strong>Duration: </strong>2 hours</p>\n\n\t\t<p><strong>Venue: </strong>Fulham Wine Cellars</p>\n\n\n\n\t</div>\n\n\t<div>Event Price: £30.00\n\n\t\t</div>\n</div>\n",
    "logo": "http://images.planvine.com/Zon0v75D3zBO_gmcqJD9BR3DZrM=/290x290/smart/s3.amazonaws.com/com.planvine.v4.image/dbcc2aa8f88d44a3b8f8d21decc51520.png?eventId=184485?lun=605fb574c5a221900ccce22c1372bd0de84d9e5f",
    "orderWeight": 85.38326907721975,
