    "link": "http://www.westlondonwineschool.com/product_info.php?id=503",
    "byline": "Food & Drink Events",
    "description": "<div>\n<div>\n\n\t\t<p><strong>Commences 14th February over four Tuesdays. </strong></p>\n\n<p>This fascinating course will focus on the <strong>classic wine regions of France </strong>and compare them <strong>against the best of the New World</strong>. Join us each evening as we taste several pairs of wines, made from the same grape variety but from different countries. Do you think you can tell the difference between Syrah from the south of France and Shiraz from the Barossa Valley? By the end of the course you will be able too! <strong>We will compare Cabernet Sauvignon, Syrah/Shiraz, Pinot Noir, Sauvignon Blanc, Riesling, Chardonnay and more</strong> from the best locations and producers from France and the New World.</p>\n\n<p>It is only when you taste these wines together that the differences really stand out. The comparisons can bring some amazing insights into wine styles. We will taste wines from Australia, New Zealand, South Africa, Chile, Argentina, California, and compare them with wines from the Loire, Burgundy, Bordeaux, Rhone, Alsace and Champagne.</p>\n\n<p><strong>Course Programme (4 sessions - all Tuesdays)</strong>:</p>\n\n<p><b>14th Feb</b> -  Burgundy &amp; Champagne vs - looking at Chardonnay and Pinot Noir <br><b>21st Feb</b> - Bordeaux vs - looking at Cabernet Sauvignon, Merlot, Semillon and Sauvignon Blanc (red, dry white and sweet white wines will be tasted)<br><strong>28th Feb</strong> - Loire vs - looking at Sauvignon Blanc, Chenin Blanc and Cabernet Franc <br><b>7th March</b> - Rhone and Alsace vs - looking at Grenache, Syrah and Riesling</p>\n\n<p><br>\n\nAll in all a fantastic opportunity to taste <strong>25-30 exciting wines</strong> and discover those you like best. Challenge the way you think about wine - forever!</p>\n\n<p><strong>Course Feedback:</strong></p>\n\n<p>\"I enjoyed it so much I booked for 2 more tastings in the next few weeks. If you're thinking of doing a wine tasting then book with West London Wine School - you won’t regret it\"<strong> (Gary L via TripAdvisor 18/07/14)</strong></p>\n\n<p><strong>Key Details:</strong></p>\n\n<p>Professional ISO tasting glasses, comprehensive tasting notes and canapes/cheeses/nibbles are all provided.</p>\n\n<p><br><strong>Please note</strong>: There is an additonal cost of £10 per evening per person payable in cash (this covers the cost of the wine and nibbles on the night). The total cost of the course over four weeks is £100. A saving of around £20 if you were to book the four sessions separately.<br>\n\n </p>\n<p><strong>Places remaining: </strong>12</p>\n\n\t\t<p><strong>Course Date/Time: </strong>Tue 14th Feb 2017 at 7pm</p>\n\n\t\t<p><strong>Duration: </strong>2 hours for 4 weeks</p>\n\n\t\t<p><strong>Venue: </strong>Fulham Wine Cellars</p>\n\n\n\n\t</div>\n\n\t<div>Event Price: £60.00\n\n\t\t<a href=\"http://www.westlondonwineschool.com/basket_add.php?id=607\" target=\"_blank\"></a>\n\n\t</div>\n</div>\n",
