    "byline": "Food & Drink Events",
    "description": "<div>\n<div>\n\n\t\t<p><strong>J</strong>oin us to review the contest that has been in full-swing for the past 3 decades, <strong>Bordeaux versus the New World</strong>. At the forefront of the comparison lies the top first growths of Bordeaux against the boutique wineries of California, but the contest filters down throughout all the wines found in these two regions. In addition to comparing the <strong>Cabernet Sauvignons </strong>and <strong>Merlots</strong> of Bordeaux against the U.S we shall also look at Australia, New Zealand and South Africa. In addition we'll look at the Sauvignon Blancs and Semillons of Bordeaux against the New World. This echoes the famous <strong>Judgement of Paris</strong> Tasting in 1976...</p>\n\n<p>Does the favoured climatic conditions of the New World suit these Bordeaux grape varieties more? Is it a triumph for the traditionalist or a victory for the modernist? Book now to explore this wonderful tasting...</p>\n\n<p>\"First-rate tasting - very enjoyable &amp; would recommend\" <strong>(Alastair Mills, Oct 2013)</strong></p>\n\n<p><strong>All tastings include; </strong>minimum of 6 wines sourced locally so you can find them easily if you like them, full tasting notes, tasting sheet, use of professional tastings glasses and nibbles.</p>\n<p><strong>Places remaining: </strong>10</p>\n\n\t\t<p><strong>Course Date/Time: </strong>Tue 21st Feb 2017 at 7pm</p>\n\n\t\t<p><strong>Duration: </strong>2 hours</p>\n\n\t\t<p><strong>Venue: </strong>The Wine Cellars, Fulham</p>\n\n\n\n\t</div>\n\n\t<div>Event Price: £30.00\n\n\t\t<a href=\"http://www.westlondonwineschool.com/basket_add.php?id=117\" target=\"_blank\"></a>\n\n\t</div>\n</div>\n",
